import React, { Component } from 'react'

class House extends Component {
  constructor () {
    super()
    this.state = { houses: [] }
  }
  componentDidMount () {
    fetch('/list')
      .then(res => res.json())
      .then(houses =>
        this.setState({ houses }, () => console.log('houses fetshed', houses))
      )
  }

  render () {
    return (
      <div>
        <ul>
          {this.state.houses.map(houses => (
            <li />
          ))}
        </ul>
      </div>
    )
  }
}

export default House
